import React, { useState } from 'react'
import Nav from '../Components/Nav'
import '../Styles/Pages/Upload.css'
import Dropdown from '../Components/Dropdown';


function Upload() {

  const [showElements, setShowElements] = useState(false)
  const [isLegacyYes, setIsLegacyYes] = useState(false);
  const [isLegacyNo, setIsLegacyNo] = useState(false);

  const toggleShowContent = () => {
    setShowElements((p) => !p)
  }

  const handleCheckboxChange = (a) => {
    console.log(a)
    if(a==="yes"){
      setIsLegacyYes((p) => !p)
      setIsLegacyNo(false)
    }else{
      setIsLegacyNo((p) => !p)
      setIsLegacyYes(false)
    }
  };

  return (
    <>
        <Nav />
        <div className="upload_wrapper">
          <div className="upload_container">
              <div className="upload_header">
                <h2>Base Material Info</h2>
              </div>
              <form action="">
                {/* Legacy Data */}
                <div className="form_content">
                  <p>Legacy data</p>
                  <label htmlFor="">
                      <div className="islegacy_btn" onClick={() => handleCheckboxChange("yes")}>
                      {
                        isLegacyYes ? <ion-icon name="radio-button-on-outline"></ion-icon>:  <ion-icon name="radio-button-off-outline"></ion-icon>
                      }
                        Yes
                      </div>
                  </label>
                  <label htmlFor="">
                      <div className="islegacy_btn" onClick={() => handleCheckboxChange("no")}>
                      {
                        isLegacyNo ? <ion-icon name="radio-button-on-outline"></ion-icon>:  <ion-icon name="radio-button-off-outline"></ion-icon>
                      }
                        No
                      </div>
                  </label>
                </div>

                <div className="form_content legacy_search">
                {/* search DB */}
                  <input type="text" placeholder='Search Database' />
                  <ion-icon name="search-outline"></ion-icon>
                </div>

                <div className="form_content">
                  <div className="btn" onClick={toggleShowContent}>
                    <ion-icon name="add-outline"></ion-icon> Add Element
                  </div>
                </div>

                {
                  showElements && (
                    <div>
                      <h3>Add Element</h3>
                    </div>
                  )
                }

                <div className="add_element_container">
                  <div className="ade_content">
                        <div className="dropdown_box">
                            <div className="dropdown_header_section">
                              <div className="dropdown_header" onClick={() => setIsDroped(!isDroped)}>
                                        {
                                            value.length>0 ? value.join(",") : "Master Class"
                                        }
                                    <div className="dropdown_icon">
                                        {
                                            isDroped ? <ion-icon name="chevron-up-outline"></ion-icon> : <ion-icon name="chevron-down-outline"></ion-icon>
                                        }
                                    </div>
                              </div>    
                              {
                                isDroped ? <ion-icon name="close-outline" style={{color:"red"}} onClick={resetField}></ion-icon> : ''
                              }
                            </div>

                            <div className={isDroped ? `dropdown_list` : `dropdown_list_hidden`}>
                            
                                <li><input type="checkbox" value="One" onChange={(e) => handleChange(e)} />One</li>
                                <li><input type="checkbox" value="Two" onChange={(e) => handleChange(e)} />Two</li>
                                <li><input type="checkbox" value="2" onChange={(e) => handleChange(e)} />2</li>
                                <li><input type="checkbox" value="Three" onChange={(e) => handleChange(e)} />Three</li>
                                <li><input type="checkbox" value="Four" onChange={(e) => handleChange(e)} />Four</li>
                                <li><input type="checkbox" value="Five" onChange={(e) => handleChange(e)} />Five</li>
                                <li><input type="checkbox" value="Six" onChange={(e) => handleChange(e)} />Six</li>

                            </div>
                    </div>
                  </div>
                </div>

              </form>
          </div>
        </div>
    </>
  )
}

export default Upload
